import React from "react";
import "./Workplace.css";
import deski_ash from "../assets/deski_ash.svg";
import { Link } from "react-router-dom";

function Workplace() {
    return (
        <div>
            <header>
                <img src={deski_ash} alt="" height="50" width="90" />
                <div className="wrk_nav">
                    <Link to="/workplace" className="wrknav_links">
                        Home
                    </Link>
                    <Link to="/feed" className="wrknav_links">
                        Feed
                    </Link>
                    <Link to="/templates" className="wrknav_links">
                        Templates
                    </Link>
                </div>
            </header>
        </div>
    );
}

export default Workplace;
